call function Module(name) { this.name = name;
} Module.prototype.getName = function() { const changeName = function() { console.log(this); return this.name + "입니다."; }; // return changeName.call(this, 1,2,3,4); return changeName.call(this);
}; const module = new Module("BKJang"); console.log(module.getName()); apply function Module(name) { this.name = name;
} Module.prototype.getName = function() { const changeName = function() { console.log(this); return this.name + "입니다."; }; // return changeName.apply(this, [1,2,3,4]); return changeName.apply(this);
}; const module = new Module("BKJang"); console.log(module.getName()); 또한 call 이나 apply 메서드를 활용하여 유사배열 객체를 일반 배열로 바꿀 수도 있다. function sayHello() { console.log(arguments); var args = Array.prototype.slice.apply(arguments); console.log(args);
} sayHello("Im-D", "South Korea"); call 과 apply 는 내부 함수에서 사용할 this를 설정하고 함수 바로 실행까지 해주지만, bind 는 this 만 설정해주고 함수 실행은 하지 않고 함수를 반환한다. function Module(name) { this.name = name;
} Module.prototype.getName = function() { const changeName = function() { console.log(this); return this.name + "입니다."; }; let bindChangeName = changeName.bind(this); return bindChangeName();
}; const module = new Module("BKJang"); console.log(module.getName());

