var obj = { organization: "Im-D", outerFunc: function() { var that = this; console.log(this.organization); innerFunc = function() { console.log(that.organization); console.log(this.organization); }; innerFunc(); }
}; obj.outerFunc(); var obj = { organization: "Im-D", outerFunc: function() { console.log(this.organization); innerFunc = () => { console.log(this.organization); }; innerFunc(); }
}; obj.outerFunc(); ES5 에서는 원래 내부 함수에서의 this 는 window 객체에 바인딩 되었기 때문에 var that=this; 와 같이 선언하여 that 에 this 를 할당하고 내부 함수에서는 that 을 활용하는 방식을 사용했었다. 하지만, ES6 에서 등장한 화살표 함수에서는 this가 무조건 상위 스코프의 this를 가리킨다. 이에 따라 내부함수에서 var that=this; 와 같은 구문을 사용할 필요가 없다. 이처럼 정적으로 this 가 바인딩되기 때문에 Lexical this 라고 한다. 🙏 Reference SeonHyungJo - Javascript-Book Im-D/Dev-Docs -Javascript의 this Zerocho - 자바스크립트의 this는 무엇인가

