프로토타입 객체 역시 객체다. 따라서, 객체의 프로퍼티를 동적으로 추가하거나 삭제할 수 있다. function Developer(name) { this.name = name;
} var web = new Developer("BKJang"); web.printAge(25); // Uncaught TypeError: web.printAge is not a function 위의 코드의 결과를 보면 web객체에서 printAge() 라는 메서드가 없기 때문에 에러가 나는 것을 볼 수 있다. function Developer(name) { this.name = name;
