}; web.printAge(25); // The age of this developer is 25 web 객체의 프로토타입 객체(부모 객체)인 Developer.prototype 객체에 printAge(age) 라는 메서드를 추가했다. 이에 따라 web 객체에서 printAge(age) 메서드에 접근하면 결과 값을 출력 하는 것을 볼 수 있다. JavaScript

