자바스크립트에서 숫자, 문자열과 같은 기본 데이터 타입에서 사용되는 표준 메서드의 경우 Number.prototype 과 String.prototype 객체에 정의 되어 있다. var str = "hello world"; str.printStr = function(text) { console.log(text);
}; str.printStr("This is the test"); //Uncaught TypeError: str.printStr is not a function 원시 데이터 타입인 문자열의 경우에는 객체가 아니기 때문에 프로퍼티를 동적으로 추가할 수 없다. 그렇다면, 위에서 str 변수에 printStr 메서드를 동적으로 추가하는 코드에서는 왜 에러가 발생하지 않을까? 그 이유는 기본 데이터 타입으로 프로퍼티나 메소드를 호출하면 기본 데이터 타입과 연관된 객체로 일시적으로 변환되어 프로토타입 객체를 공유하게 되기 때문 이다. var str = "hello world"; String.prototype.printStr = function(text) { console.log(text);
}; str.printStr("This is the test"); //This is the test
"this is string".printStr("This is the test"); //This is the test 문자열 타입의 경우, String.prototype 객체에 표준 메서드가 정의 되어있기 때문에 해당 객체에 메서드를 추가해주면 기본 데이터 타입에서도 해당 메서드를 사용할 수 있다. var str = "hello world"; String.prototype.printStr = function(text) { console.log(text);
}; console.log(str.__proto__ === String.prototype); //1.true
console.log(String.prototype.__proto__ === Object.prototype); //2.true
console.log(String.prototype.constructor === String); //3.true
console.log(String.__proto__ === Function.prototype); //4.true
console.log(Function.prototype.__proto__ === Object.prototype); //5.true str.printStr("This is the test"); //This is the test JavaScript

