자바스크립트에서 특정 객체는 부모 객체인 프로토타입 객체를 임의로 변경할 수 있다. function Developer(name) { this.name = name;
} var web = new Developer("BKJang"); Developer.prototype = { age: 25 }; var android = new Developer("YAKim"); console.log(web.age); //undefined
console.log(android.age); //25 console.log(web.constructor); //Developer(name)
console.log(android.constructor); //Object() 변경 전 : 파란색 번호 변경 후 : 주황색 번호 JavaScript 프로토타입 객체를 변경하기 전, web객체의 constructor 는 프로토타입 체이닝에 따라 Developer() 생성자 함수 를 가리킨다. 프로토타입 객체를 변경한 후, android객체의 constructor 는 Object() 함수 를 가리킨다. 프로토타입 객체가 변경되면서 Developer.prototype 객체의 constructor 프로퍼티와 Developer() 생성자 함수의 연결이 깨진다. 이에 따라 프로토타입 체인이 동작하고 android 객체의 constructor 는 Object.prototype 객체의 constructor 프로퍼티가 가리키는 Object() 함수 가 되는 것이다. 프로토타입 객체를 변경하기 전과 후의 프로토타입 링크([[Prototype]] 프로퍼티)는 각각 다른 프로토타입 객체와 바인딩 된다. 프로토타입 객체를 변경한 후에는 프로토타입 객체의 constructor 프로퍼티와 생성자 함수와의 연결이 깨진다.

