클로저는 실행 컨텍스트 와 밀접한 관련이 있다. 생성된 함수 객체는 [[Scopes]] 프로퍼티를 가지게 된다. [[Scopes]] 프로퍼티는 함수 객체만이 소유하는 내부 프로퍼티(Internal Property)로서 현재 실행 컨텍스트의 스코프 체인이 참조하고 있는 객체를 값으로 설정 한다. JavaScript 내부 함수의 [[Scopes]] 프로퍼티는 자신의 실행 환경(Lexical Enviroment) 과 자신을 포함하는 외부 함수의 실행 환경과 전역 객체 를 가리킨다. 이 때, 자신을 포함하는 외부 함수의 실행 컨텍스트가 소멸하여도 [[Scopes]] 프로퍼티가 가리키는 외부 함수의 실행 환경(Activation Object)은 소멸하지 않고 참조 할 수 있다. 이것이 클로저 이다. 외부함수에서 내부함수를 반환하는 코드를 보자. function foo() { var x = "variable of outerFunc"; function bar() { console.log(x); } return bar;
} var innerFunc = foo();
innerFunc(); //variable of outerFunc 위의 코드를 보면 외부함수 foo() 에서 bar() 를 반환하고 소멸한다. 외부함수 foo() 는 실행된 이후, 실행 컨텍스트 스택에서 제거되기 때문에 변수 x 도 같이 소멸될 것으로 보인다. 이에 따라 변수 x 에 접근할 방법이 없어 보인다. 하지만 innerFunc() 함수를 호출하면 변수 x의 값이 출력되는 것을 볼 수 있다. 이처럼 클로저는 외부함수( foo() ) 밖에서 내부함수( bar() )가 호출되더라도 외부함수의 지역 변수( var x )에 접근할 수 있다. JavaScript 클로저가 외부함수 밖에서 내부함수가 호출되더라도 외부함수의 지역 변수에 접근할 수 있는 이유를 설명한 그림이다. 외부함수인 foo() 함수가 종료되면 함수 실행 컨텍스트도 소멸하지만 foo() 함수 실행 컨텍스트의 활성 객체는 유효 하다. 이 때문에 외부 함수 foo() 가 실행이 종료되어도 내부 함수 bar() 에서 접근이 가능한 것 이다. 클로저를 사용하면 클로저에서의 스코프 체인 접근 방식 , 메모리의 부담 등의 이유로 성능적인 면과 자원적인 면에서 손해를 볼 수 있다. 그렇기 때문에 좋은 구현을 위해서는 충분한 경험을 쌓을 필요가 있다.

