} calculator(); //1
calculator(); //2
calculator(); //3 위의 결과는 에상대로 잘 나오고 있지만 전역 변수 counter 를 쓰고 있다. 전역 변수는 어디서든 접근이 가능하기 때문에 값이 변할 수 있고 이에 따라 오류를 불러올 수 있다. var outerFunc = (function() { var counter = 0; function calculater() { return console.log(++counter); } return calculater;
})(); outerFunc(); //1
outerFunc(); //2
outerFunc(); //3 위의 코드와 같이 클로저를 이용하면 전역 변수의 사용을 줄일 수 있다.

