클로저를 활용하는데 있어 주의할 사항에 대해 설명할 때 가장 많이 등장하는게 이 경우다. function count(numberOfCount) { for (var i = 1; i <= numberOfCount; i++) { setTimeout(function() { console.log(i); }, i * 1000); }
} count(4); 보면 알겠지만, 위 코드의 의도는 1초 간격으로 1,2,3,4를 출력하는 것이다. 하지만 결과는 예상과 다르게 5가 4번 1초 간격으로 출력 된다. 그 이유는 변수 i 는 외부함수의 변수가 아닌 전역변수이고 setTimeout() 함수가 실행되는 시점은 count() 함수가 종료된 이후 다. 이 때는 이미 i 의 값이 5인 상태이다. function count(numberOfCount) { for (var i = 1; i <= numberOfCount; i++) { (function(j) { setTimeout(function() { console.log(j); }, i * 1000); })(i); }
} count(4); 즉시 실행 함수를 실행시켜 루프의 i 값을 j 에 복사하고 setTimeout() 함수에서 사용했다. 이 때 j 는 상위스코프의 자유변수이므로 그 값이 유지 된다. 이러한 문제는 자바스크립트의 함수형 스코프로 인해 for 루프의 초기문에서 사용된 변수는 전역 스코프 를 가지기 때문에 발생한다. ES6에서는 let 을 이용해 블록 레벨 스코프 를 구현할 수 있다. function count(numberOfCount) { for (let i = 1; i <= numberOfCount; i++) { setTimeout(function() { console.log(i); }, i * 1000); }
} count(4); 첫 번째 코드에서 var 를 let 으로만 바꿔주면 위의 코드처럼 깔끔하게 구현할 수 있다. 🙏 Reference [인사이드 자바스크립트 (송형주, 고형준)] Poiemaweb - Closure

