rest 파라미터는 Spread 연산자( ... )를 사용하여 파라미터를 정의한다. 기존에 ES5에서는 가변 파라미터를 정의할 때 arguments 객체를 사용할 수 있었지만 이를 rest 파라미터 로 대체할 수 있다. //ES5
function foo() { console.log(Array.isArray(arguments)); console.log(arguments);
} foo(1, 2, 3, 4, 5);
/*
false
{'0': 1, '1': 2, '2': 3, '3': 4, '4': 5, length: 5}
*/ //ES6
function foo(...rest) { console.log(Array.isArray(rest)); console.log(rest);
} foo(1, 2, 3, 4, 5);
/*
true
[1, 2, 3, 4, 5]
*/ 위의 결과를 보면 arguments 객체와 rest 파라미터의 중요한 차이를 알 수 있다. arguments 객체는 유사배열 객체 다. 따라서 Array.isArray(arguments) 의 결과는 false를 반환한다. 여기서 큰 차이가 발생하는데 유사배열객체는 배열의 메서드를 사용할 수 없다. 배열의 메서드를 사용하기 위해서는 이를 배열로 변환하는 과정을 거쳐야하는 불편함 이 있다. 하지만 가변 인자 함수를 rest 파라미터로 정의하면 파라미터는 배열의 형태로 넘어온다. 또한 ES6의 화살표 함수(Arrow Function) 에서는 arguments 를 사용할 수 없다. //ES6 화살표 함수
const foo = () => { console.log(arguments);
}; foo(1, 2, 3, 4, 5); //Uncaught ReferenceError: arguments is not defined rest 파라미터는 arguments 와 달리 배열 로 파라미터가 넘어온다. ES6의 화살표 함수에서는 arguments 를 사용할 수 없다.

