console.log([1, 2, ...arr1, 3, 4]); //[1, 2, 5, 6, 3, 4] 단순히 앞, 뒤에 배열의 요소를 붙이는데는 concat 이 성능이 더 좋다. 하지만 중간에 특정 배열의 값을 추가하고 싶다면 Spread 연산자를 사용하는 것도 좋은 방법이다. split 문자열을 배열로 변환할 때 많이 쓰이는 함수가 split() 이다. 이 또한 Spread 연산자를 활용하면 좀 더 편하게 변환할 수 있다. //split var a = "Hello";
