이벤트 루프의 역할은 생각보다 단순한다. 호출 스택에 실행 중인 작업이 있는지, 이벤트 큐에 대기 중인 작업이 있는지 반복해서 확인한다. 만약 호출 스택이 비어있다면 이벤트 큐에 있는 작업을 호출 스택으로 옮긴다. 그리고 이 작업을 수행하는 것은 결국 호출 스택이다. function func1() { console.log("func1"); func2();
} function func2() { setTimeout(function() { console.log("func2"); }, 0); func3();
} function func3() { console.log("func3");
} func1(); 위 예제는 이벤트 루프를 설명할 때 가장 많이 사용되는 예제다. 만약, 이벤트 루프가 수행하는 과정이 없고 순차적으로 호출 스택에만 쌓이게 된다면 func1 , func2 , func3 의 순서로 출력될 것이다. 하지만 실제로 위 코드를 실행해보면 func1 , func3 , func2 의 순서로 출력되는 것을 볼 수 있을 것이다. 이런 결과가 나오는 이유는 위에서 설명한 것 처럼 이벤트 큐와 이벤트 루프를 통해 비동기 처리를 수행하는 setTimeout 함수가 다른 함수들과 다르게 동작하기 때문이다. 아래 이미지는 위 코드가 실행되는 과정을 보여준다. event_loop_gif 이미지 출처: https://poiemaweb.com/js-event 위 과정을 순차적으로 정리하면 다음과 같다. func1 함수가 호출되고 이는 호출 스택에 올라가고 console.log('func1') 이 실행된다. func2 함수가 호출 스택에 올라가고 setTimout 함수를 호출한다. 호출된 setTimeout 함수의 수행은 비동기적 처리를 수행하는 Web API에 넘어간다. func3 함수가 호출 스택에 올라가고 console.log('func3') 이 실행된다. Web API에서 setTimout 함수에서 지정한 시간이 지나면 callback 함수를 이벤트 큐로 넘긴다. 작업이 끝난 func3 , func2 , func1 은 순차적으로 호출 스택에서 제거된다. 이벤트 루프는 호출 스택에 작업 중인 태스크가 없는 것을 확인하고 이벤트 큐에 있는 callback 함수를 호출 스택으로 올린다. 호출 스택에 올라간 callback 함수가 실행되면서 console.log('func3') 가 실행된다. 위 설명에서 주의 깊게 볼 것은 비동기 함수인 setTimeout 함수에 세팅된 시간이 3초라면 3초 후에 콜백 함수를 실행시켜라 가 아닌 3초 후에 콜백 함수를 이벤트 큐에 넣어라 가 된다는 것이다. 즉, setTimeout 함수는 n초 뒤에 콜백을 단순히 큐에 집어넣는게 끝이다. 코드를 간단히 보자면 아래와 같다. var eventLoop = [];
var event; while (true) { // 틱! if (eventLoop.length > 0) { event = eventLoop.shift(); } try { event(); // 호출스택으로 밀어넣는다 } catch (err) { //... }
} 이 큐에 이미 대기번호가 100개가 있다면 func3 는 101번째 대기표를 받게 될 것이다. 따라서 setTimeout 은 지정한 시간동안은 실행되지 않는 것은 보장할 수 있지만 지정한 시간에 실행되는것은 보장할 수 없다. while (await messageQueue.nextMessage()) { let message = messageQueue.shift(); message.run();
} 결론적으로, 이벤트 루프는 메시지 큐에 메시지가 더 있는지 확인하는 루프이다. 메시지 큐에 메시지가 있으면 메시지 큐에서 다음 메시지를 제거하고 그 메시지와 연관된 기능을 호출 스택으로 보낸다. 그렇지 않으면 새 메시지가 메시지 대기열에 추가될 때까지 대기를 한다. 이벤트 루프가 자바스크립트에게 비동기를 허용하는 기본 모델이다.

