기본적으로 이벤트 루프는 위에서 설명한 내용이 큰 틀이다. 큐와 스택을 감시하며 스택의 작업이 없으면 큐의 작업을 스택에 올린다. 다만, ES6 이후에는 몇 가지 비동기적 작업을 수행하는 API들이 추가되었고 이에 따라 약간의 추가된 내용이 있다. 하지만, 전체적인 실행 방식은 동일하며 각각의 비동기 처리에 수행 순서에 초점을 두고 살펴보자. 기존에 살펴보았던 이벤트 큐(Event Queue)를 좀 더 자세히 나눠보면 다음과 같다. Task Queue : 가장 사람들이 잘 알고 있는 비동기 작업인 setTimeout 이 들어가는 큐 Micro Task Queue : ES6에서 추가된 Promise 와 ES8의 Async Await (Async Await도 결국 Promise) AnimationFrame : requestAnimationFrame(rAF) 의 콜백 함수가 들어간다. console.log("script start"); setTimeout(function() { console.log("setTimeout");
}, 0); Promise.resolve().then(function() { console.log("promise1");
}).then(function() { console.log("promise2");
}); requestAnimationFrame(function { console.log("requestAnimationFrame");
})
console.log("script end"); 위의 코드를 실행하면 다음과 같은 결과가 출력된다. script start
script end
promise1
promise2
requestAnimationFrame
setTimeout 즉, 이벤트 큐에서 나눠지는 3가지 영역의 우선 순위는 다음과 같다. Micro Task Queue => AnimationFrame => Task Queue 기존에 이벤트 루프에 대해서 이해가 된 상태라면 이 내용은 크게 어렵지 않다. 쉽게 보면 비동기 작업을 처리하는 방법이 추가되었고 이에 따라 이벤트 큐에서 내부적으로 처리하는 로직에 약간의 변화가 생겼을 뿐이다. 결국, 정리하면 다음과 같다. 비동기 작업으로 등록되는 작업은 Task 와 Micro Task , 그리고 AnimationFrame 으로 구분된다. Micro Task 는 Task 보다 먼저 처리된다. Micro Task 가 처리된 이후 requestAnimationFrame 이 호출되고 이후 브라우저 랜더링이 발생한다. Task Queue와 Micro Task Queue의 처리 과정 🙏 Reference Im-D/Dev-Docs JavaScript Event Loop Explained What is the Event Loop in Javascript Understanding JS: The Event Loop Event loop in javascript The JavaScript Event Loop Tasks, microtasks, queues and schedules Poiemaweb - 자바스크립트/이벤트

